import { motion } from "motion/react";

function BurgerMenu({ isOpen }) {
  return (
    <>
      <motion.div
        className="absolute w-full h-full bg-white z-[100]"
        animate={isOpen ? { x: 50 } : { x: 1000}}
        transition={{ duration: 0.3 , ease:"linear"}}
      ></motion.div>
    </>
  );
}

export default BurgerMenu;
